import React from 'react'

function FilterCard(props) {
  const { restarents } = props;
  return (
    <div>

      {
        restarents.map((item) => {
          return (
            <div className='card'>
              <div className="card-body">
                <img src={item.image} alt="" />
                <div className="card-header float-right">
                  {item.name}
                </div>
              </div>
            </div>
          )
        })}
    </div>
  )



}

export default FilterCard
